import styled from 'styled-components'

const Wrapper = styled.div`
    display: flex;
    align-items: center;
    flex-direction: row;
    justify-content: center;
`

const List = styled.div`
  padding: 10px;
`

function App() {
  return (
    <div className="App">
      <div>Header</div>
      <Wrapper>
        <List>Aircrafts</List>
        <List>Rotation</List>
        <List>Flights</List>
      </Wrapper>
    </div>
  );
}

export default App;
